def make_volume_from_slices(slices):
    d = len(slices)
    vol = np.zeros((500,500,d),dtype=np.float32)
    for i, slice in enumerate(slices):
        sli = np.zeros((500,500), dtype=np.float32)
        x_center, y_center = 500//2, 500//2
        w,h = slice.shape
        x = x_center - w//2
        y = y_center - h//2
        sli[x:x+w,y:y+h] = slice
        # sli = cv2.resize(sli, (256,256))
        vol[:,:,i] = sli
    
    return vol
        

class TDSC(torch.utils.data.Dataset):

    def __init__(self, path_to_dataset: str = "./data/tdsc", train=True, transform=None) -> None:
        """
        TDSC dataset constructor,
        :param path_to_dataset: Root path to the dataset
        :param type: Which type of dataset to be created (train, test, validation)
        """

        global training_data_list, validation_data_list
        
        self.path_to_dataset = path_to_dataset
        self.metadata = pd.read_csv(f"{path_to_dataset}/labels.csv", dtype={'Case_id': int, 'Label': str, 'Data_path': str, 'Mask_path': str}).set_index('case_id')
        self.transform = transform
        
        if train :
            self.data_list = training_data_list
        else:
            self.data_list = validation_data_list    
        
        self.on_epoch_end()
        
    def __getitem__(self, index) -> tuple:
        """
        Returns the related data point with as a tuple of (real volume, mask, label)
        :param index:
        :return:
        """
        
        global bbxs
        
        idx = self.data_list[index]

        label, vol_path, mask_path = self.metadata.iloc[idx]
        vol_path = vol_path.replace('\\', '/')
        mask_path = mask_path.replace('\\', '/')
        label = 0 if label == 'M' else 1
        
        
        vol, _ = nrrd.read(f"{self.path_to_dataset}/{vol_path}")
        mask, _ = nrrd.read(f"{self.path_to_dataset}/{mask_path}") 
        vol_bbxs = bbxs[idx]
        
        vol_slices = []
        mask_slices = []
        w_max = 0
        padding = 10
        for bbx in vol_bbxs:
            x,y,w,h,d = bbx
            img = vol[x-padding:x+w+padding, y-padding:y+h+padding, d]
            msk = mask[x-padding:x+w+padding, y-padding:y+h+padding, d]

            vol_slices += [img]
            mask_slices += [msk]
            
        # build target volumes
        vol = make_volume_from_slices(vol_slices)
        mask = make_volume_from_slices(mask_slices)
        
        
        
        # Apply transformers
        if self.transform is not None:
            for i in range(vol.shape[2]):
                augmentations = self.transform(image=vol[:,:,i], mask=mask[:,:,i])
                vol[:,:,i] = augmentations["image"]
                mask[:,:,i] = augmentations["mask"]
        
        return vol/255, mask, label

    def __len__(self) -> int:
        return len(self.data_list)
    
    def on_epoch_end(self):
        random.shuffle(self.data_list)
    
    def biggest_tumorSize(self):
        mz = 0
        for sample in static.tumor_locals:
            s,e = sample
            s = np.array(s)
            e = np.array(e)
            t = e-s
            mz = max(mz, t[2])
        print (mz)
            
